import Cover from './Components/Cover';
import Portfolio from './Components/Portfolio';
import Footer from './Components/Footer';

function App() {
  const [portfolioSelected, setPortfoliioSelected] = useState(false);
  return (  
    <div>

        <Header/>
        <Cover/>

       <Portfolio/>
       <Footer/>

    </div>

  );
}

export default App;
